import React, { Component } from 'react';

export default class App extends Component {
  constructor() {
    super();
    this.state = {
      count: 0,
    };
  }

  increment() {
    this.setState({
      count: 1,
    });
  }

  render() {
    return (
      <div>
        {this.state.count}
        <button onClick={this.increment.bind(this)}>+</button>
      </div>
    );
  }
}
